import {Link}  from 'react-router-dom';
import { useState } from 'react';
import {GoogleLogout} from 'react-google-login';

const Reviewheader = () =>{

  const onSuccess = (res) =>{
    console.log("LOGIN SUCCESS! Current user: ", res.profileObj);
    localStorage.setItem ("userid", res.profileObj.googleId);
    // here we store login details in the chrome local storage so that we can login
    localStorage.setItem("fullname", res.profileObj.name);
    window.location.href="http://localhost:3000/#/"
  window.location.reload();// Reload the page(app.js) after login is success
   
 }


  const logout = () =>{
    <GoogleLogout
              clientId= {clientId}
              buttonText= {"Logout"}
              onLogoutSuccess={onSuccess}
             />
    
    
    //other method - window.location.href="http://localhost:3000/#/";
  }
  
    let[isHidden, setIsHidden] = useState(true);
    return(
        <nav className="navbar bg-body-tertiary bg-dark  p-4 h1">
          <div className="container-fluid">
         <span className="navbar-brand mb-0 h1">Feedback Portal</span>
           {/* hide the button onclick */}
           <div className="btn btn-group">
          <Link to="/Addfeedback" className="menu"> {isHidden && <button className="btn btn-danger rounded" type="submit" onClick={() => setIsHidden(false)}>Add Feedback</button>} </Link>
          <button className="btn btn-warning" onClick={logout}> Welcome - {localStorage.getItem("fullname") } Logout <i className="fa fa-power-off"></i>  </button>
          </div>
      </div>
       </nav>
    
    )
}
export default Reviewheader;
